Gina Lynn - Eye Will Fuck You
Added: July 01, 2010

Optometrist Gina receives a patient who claims his job is causing him to go blind. She tries some extra special tests to determine that he's only faking his blindness in order to get workman's compensation. But Gina is willing to help him out with his little scam if he helps her out with a dose of deep dicking!
